@nashty_SunsFan @andy8052 @economist Someone recently asked why is YL trying VC route. Could be for this.

Network effect and security - POS with ape holders as validator nodes

5B valuation is less for a built out Blockchain like Matic, not for one just starting. That potential for growth gets VC money

@LinusCaldwell5 @0x_fxnction @Hm0n3yy @ape_g4ng @yugalabs You both are right as you are talking about 2 different things.

Tokens will be for Ape DAO. Ape DAO will gets benefits from YugaLabs and Ape ecosystem, which will give value to the DAO

YugaLabs as an entity can choose to go VC route (or even Public) for growing beyond BAYC

